 //your lib assets\n  // ])\n  return new TranslateHttpLoader(http, 'assets/i18n/', '.json');\n}\n\n@NgModule({\n  declarations: [\n    RestResourceListComponent,\n    RestResourceAddComponent,\n    RestResourceDeleteComponent,\n    RestMainComponentComponent,\n    RestResourceEditorFieldsComponent,\n    RestResourceListFieldComponent,\n    RestResourceDetailComponent,\n    UploadFileComponent,\n    FsIconCComponent,\n    LoginComponent,\n    AttributeDirective,\n  ],\n  exports: [\n    RestResourceListComponent,\n    RestResourceAddComponent,\n    RestResourceDeleteComponent,\n    RestMainComponentComponent,\n    RestResourceEditorFieldsComponent,\n    RestResourceListFieldComponent,\n    RestResourceDetailComponent,\n    UploadFileComponent,\n    LoginComponent,\n  ],\n  entryComponents: [\n    RestResourceListComponent,\n    RestResourceListFieldComponent,\n    RestResourceAddComponent,\n    FsIconCComponent,\n    RestResourceDeleteComponent,\n    RestMainComponentComponent,\n    RestResourceEditorFieldsComponent,\n    RestResourceDetailComponent,\n    UploadFileComponent,\n    LoginComponent,\n  ],\n  imports: [\n    CommonModule,\n    BrowserModule,\n    BrowserAnimationsModule,\n    RouterModule,\n    ReactiveFormsModule,\n    FormsModule,\n    HttpClientModule,\n    NbActionsModule,\n    NbButtonModule,\n    NbCardModule,\n    NbCheckboxModule,\n    NbInputModule,\n    NbTagModule,\n    NbRadioModule,\n    NbUserModule,\n    NbTreeGridModule,\n    NbAlertModule,\n    NbAutocompleteModule,\n    Ng2SmartTableModule,\n    FileUploadModule,\n    CngHtmlCompilerModule,\n    NbSpinnerModule,\n    NbTabsetModule,\n    NbPopoverModule,\n    ImageCropperModule,\n    NbToggleModule,\n    NbListModule,\n    NbTooltipModule,\n    NbContextMenuModule,\n    TranslateModule,\n    NgxDropzoneModule,\n    NgxPermissionsModule.forChild(),\n\n    NbSelectModule,\n    NbSidebarModule,\n    NbMenuModule.forRoot(),\n    NbDatepickerModule.forRoot(),\n    NbDialogModule.forRoot(),\n    NbWindowModule.forRoot(),\n    NbToastrModule.forRoot(),\n    NbTimepickerModule.forRoot(),\n    CoreModule.forRoot(),\n    ThemeModule.forRoot(),\n    NbIconModule,\n    TranslateModule.forRoot({\n      loader: {\n        provide: TranslateLoader,\n        useFactory: createTranslateHttpLoader,\n        deps: [HttpClient],\n      },\n    }),\n  ],\n  providers: [\n    { provide: HTTP_INTERCEPTORS, useClass: HttpAuthInterceptor, multi: true },\n    { provide: HTTP_INTERCEPTORS, useClass: HttpErrorInterceptor, multi: true },\n    {\n      provide: HTTP_INTERCEPTORS,\n      useClass: PaginationInterceptor,\n      multi: true,\n    },\n    AuthGuard,\n    isAuthGuard,\n    RestResourceService,\n    RestAdminConfigService,\n    RestExportService,\n    RestLangService,\n    NotificationService,\n    RestShareService,\n  ],\n})\nexport class RestAdminModule {\n  constructor(\n    private router: Router,\n    private compiler: Compiler,\n    private serviceRestAdmin: RestAdminConfigService,\n    private iconLibraries: NbIconLibraries,\n    private restLangService: RestLangService\n  ) {\n    this.iconLibraries.registerFontPack('fas', {\n      packClass: 'fas',\n      iconClassPrefix: 'fa',\n    });\n    this.iconLibraries.registerFontPack('far', {\n      packClass: 'far',\n      iconClassPrefix: 'fa',\n    });\n    this.iconLibraries.registerFontPack('fab', {\n      packClass: 'fab',\n      iconClassPrefix: 'fa',\n    });\n    this.iconLibraries.registerFontPack('fad', {\n      packClass: 'fa-duotone',\n      iconClassPrefix: 'fa',\n    });\n    this.restLangService.setInitialAppLanguage();\n\n    const tempModule = NgModule({\n      imports: [\n        RouterModule.forChild([\n          {\n            path: 'login',\n            component: NbAuthComponent,\n            canActivate: [isAuthGuard],\n            children: [\n              {\n                path: '',\n                component: LoginComponent,\n              },\n            ],\n          },\n          {